import { noticeSave, productSave } from "./save";
import {
    getNotices,
    getOneNotice,
    getOneProduct,
    getProducts,
    getCategories,
} from "./load";
import { noticeDelete, productDelete } from "./delete";

const data = {
    products: {
        time: 0,
        data: null,
    },
    notices: {
        time: 0,
        data: null,
    },
    categories: {
        time: 0,
        data: null,
    },
};

export {
    getOneNotice,
    getOneProduct,
    getNotices,
    getProducts,
    getCategories,
    noticeDelete,
    noticeSave,
    productSave,
    productDelete,
};
